import classes from './MealItemForm.module.css'

const formSubmithandler = (event) => {
  event.preventdefault();
};

const MealItemForm = () => {
  return (
    <form onSubmit={formSubmithandler} className={classes.form}>
      <label>Quatity</label>
      <input />
      <button type="submit" />
    </form>
  );
};

export default MealItemForm;
